    const day = dt.getDay(); // 요일
    console.log(year)
    console.log(month)
    console.log(date)
    console.log(day)
    return (
        <>
        <h2>{year}년 {month}월 {date}일</h2>
        <p>{day}요일</p>
        </>
    )
}
